import React from "react";
import { number, string, arrayOf, shape } from "prop-types";

const propTypes = {
  title: string.isRequired,
  employerName: string.isRequired,
  startDate: string.isRequired,
  endDate: string.isRequired,
  cols: number,
  otherTitles: arrayOf(
    shape({
      title: string.isRequired,
      startDate: string.isRequired,
      endDate: string.isRequired,
    })
  ),
};

const defaultProps = {
  cols: 6,
};

const Employer = ({
  title,
  company,
  start,
  end,
  otherTitles,
  cols,
  children,
}) => {
  return (
    <div className="row mb-5">
      <div className="col-12 col-sm-6 text-left">
        <h3 className="xmar">{title}</h3>
        <p className="italic t-lg xmar">{employerName}</p>
        <p className="upper strong">{`${startDate} - ${endDate}`}</p>
        {otherTitles &&
          otherTitles.map((job) => (
            <>
              <h3 className="xmar">job.title</h3>
              <p className="upper strong">{`${job.startDate} - ${job.endDate}`}</p>
            </>
          ))}
      </div>
      <div className={`col-12 col-sm-${cols}`}>{children}</div>
    </div>
  );
};

Employer.propTypes = propTypes;
Employer.defaultProps = defaultProps;

export default Employer;
